import { library } from '@fortawesome/fontawesome-svg-core';
import {
  faLaptopCode,
  faToolbox,
  faPaperPlane,
  faSun,
  faMoon,
  faLevelDownAlt,
  faTimes,
  faExternalLinkAlt,
} from '@fortawesome/free-solid-svg-icons';

import {
  faGithub,
  faGitlab,
  faInstagram,
  faLinkedin,
} from '@fortawesome/free-brands-svg-icons';

library.add(
  faLaptopCode,
  faToolbox,
  faPaperPlane,
  faSun,
  faMoon,
  faLevelDownAlt,
  faTimes,
  faGithub,
  faGitlab,
  faInstagram,
  faExternalLinkAlt,
  faLinkedin
);

export default { library };
